PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE ElementToInstanceMap (
Id UNIQUEIDENTIFIER not null,
Data BLOB not null,
primary key (Id)
);
CREATE TABLE InstanceChangeSet (
InstanceId UNIQUEIDENTIFIER not null,
ChangeSetId UNIQUEIDENTIFIER not null,
ElementId UNIQUEIDENTIFIER not null,
State INTEGER not null,
primary key (ElementId, ChangeSetId)
);
CREATE TABLE Instance (
Id UNIQUEIDENTIFIER not null,
Element_id UNIQUEIDENTIFIER not null,
ContentHash TEXT,
Children BLOB,
Tags TEXT,
ParentElementId UNIQUEIDENTIFIER,
LabelElement_id UNIQUEIDENTIFIER,
DescriptionElement_id UNIQUEIDENTIFIER,
InstanceType TEXT,
ObjectId UNIQUEIDENTIFIER not null,
primary key (Id)
);
CREATE TABLE Content (
Hash TEXT not null,
Data BLOB not null,
Format TEXT not null,
primary key (Hash)
);
CREATE TABLE Element (
Id UNIQUEIDENTIFIER not null,
Type INTEGER not null,
CommentElement_id UNIQUEIDENTIFIER,
primary key (Id)
);
CREATE TABLE ChangeSet (
Id UNIQUEIDENTIFIER not null,
Author TEXT not null,
DateTime DATETIME not null,
Comment TEXT not null,
MachineName TEXT not null,
Parent1ChangeSet_id UNIQUEIDENTIFIER,
Parent2ChangeSet_id UNIQUEIDENTIFIER,
BaseElementMapId UNIQUEIDENTIFIER not null,
DeltaElementMapId UNIQUEIDENTIFIER not null,
primary key (Id)
);
CREATE TABLE Branch (
Baseline TEXT not null,
Name TEXT not null,
Head UNIQUEIDENTIFIER not null,
primary key (Baseline, Name)
);
CREATE INDEX exam_autoindex_Branch_Name ON Branch ( Name );
CREATE INDEX exam_autoindex_Branch_Head ON Branch ( Head );
CREATE INDEX exam_autoindex_Element_Type ON Element ( Type );
COMMIT;
